function swap(e,t,r){var n=e[t];e[t]=e[r],e[r]=n}function randomIntInRange(e,t){return Math.round(e+Math.random()*(t-e))}function doQuickSort(e,t,r,n){if(n>r){var i=randomIntInRange(r,n),a=r-1;swap(e,i,n);for(var o=e[n],s=r;n>s;s++)t(e[s],o)<=0&&(a+=1,swap(e,a,s));swap(e,a+1,s);var u=a+1;doQuickSort(e,t,r,u-1),doQuickSort(e,t,u+1,n)}}exports.quickSort=function(e,t){doQuickSort(e,t,0,e.length-1)};